bool zero(const mv &a, const double b)
{
	int idx = 0;
	
	if (a.gu() & 1) {
		if (!zeroGroup_0(a.getC() + idx, b)) return false;
		idx += 1;
	}
	
	if (a.gu() & 2) {
		if (!zeroGroup_1(a.getC() + idx, b)) return false;
		idx += 8;
	}
	
	if (a.gu() & 4) {
		if (!zeroGroup_2(a.getC() + idx, b)) return false;
		idx += 28;
	}
	
	if (a.gu() & 8) {
		if (!zeroGroup_3(a.getC() + idx, b)) return false;
		idx += 56;
	}
	
	if (a.gu() & 16) {
		if (!zeroGroup_4(a.getC() + idx, b)) return false;
		idx += 70;
	}
	
	if (a.gu() & 32) {
		if (!zeroGroup_5(a.getC() + idx, b)) return false;
		idx += 56;
	}
	
	if (a.gu() & 64) {
		if (!zeroGroup_6(a.getC() + idx, b)) return false;
		idx += 28;
	}
	
	if (a.gu() & 128) {
		if (!zeroGroup_7(a.getC() + idx, b)) return false;
		idx += 8;
	}
	
	if (a.gu() & 256) {
		if (!zeroGroup_8(a.getC() + idx, b)) return false;
	}
	return true;
}
